const e="உடன் நாணயங்களைப் பெற முகவரியைத் தேர்வுசெய்க",t="செலவு செய்யக்கூடியது",o="மாதம்",c="ஆண்டு",a="சரி",n="புதிய நிரந்தர ஒப்பந்தத்தை உருவாக்கவும்",s="ta",l={0:"மாதாந்திர கொடுப்பனவுகளின் நீரோட்டத்தை உருவாக்குவோம்.",1:"எங்கள் நாணயம் பற்றி அறிக. அசல் ஒயிட் பேப்பரின் வெப்காமிக் பார்க்க தட்டவும்.",2:"நேரம் ஒரு நிரந்தரத்தை பூட்டுகிறது. விசைகள் ஒரு பணப்பையை திறக்கின்றன.",3:"மேலே உள்ள உங்கள் பிட்காயின் பணத்தை (பி.சி.எச்) பணப்பையைத் தேர்ந்தெடுக்கவும்.",4:"உங்கள் பணப்பையை தனிப்பட்ட விசையைக் கண்டுபிடித்து காப்புப் பிரதி எடுக்கவும்.",5:"பின்னர் மற்றொரு காப்புப்பிரதியை உருவாக்கவும்",6:"விசைகள் நாணயங்களை கட்டுப்படுத்துகின்றன; விசைகள் இல்லை, நாணயங்கள் இல்லை.",7:"உங்கள் பணப்பையிலிருந்து ஒரு முகவரியை நகலெடுக்கவும்.",8:"நீங்கள் பெறும் முகவரியை முகப்புத் திரையில் ஒட்டவும்.",9:"உங்கள் நிரந்தரத்தை பிளாக்செயினில் பதிவுசெய்க.",10:"செலுத்துதல் அட்டவணையை மதிப்பாய்வு செய்யவும்.",11:"உங்கள் நிரந்தர முகவரியை நகலெடுக்கவும்.",12:"உங்கள் நிரந்தரத்திற்கு நேரடியாக நிதியளிக்கவும் அல்லது பகிரவும்.",13:"அவ்வளவுதான், நீங்கள் செய்தீர்கள். நீ வென்றாய்!",14:"நீங்கள் கற்றுக்கொள்ள சில நிறுவனங்களை வென்றீர்கள்,",15:"... அல்லது இருங்கள்",16:"வழக்கமான வருமானம் ஒரு வீட்டிற்கு ஒரு பாதை.",17:"ஏஜென்சி மற்றவர்களுக்கு அதிகாரம் அளிக்க முடியும்.",18:"உங்கள் சக்தியை ஒருபோதும் விட்டுவிடாதீர்கள்,",19:"... ஆனால் தேவைப்படும்போது, உங்கள் திட்டத்தை திருத்தவும்.",20:"உங்கள் சொந்த தாவர உருவகத்தைக் கண்டறியவும்.",21:"நீண்ட காலம் வாழ்க",22:"மற்றும் செழித்து.",23:"",24:"",25:"",26:"",receive:e,spendable:t,month:o,year:c,ok:a,create:n,locale:s};export{n as create,l as default,s as locale,o as month,a as ok,e as receive,t as spendable,c as year};
